import Link from "next/link";
import DefaultLayout from "@layout/default";
import { home } from "pages/styles";
import Social from "../components/social/index";

export default function Home() {
  return (
    <>
      <DefaultLayout>
        <section>
          <Social></Social>
          <img className="avatar" src="./img/octocat.png" alt="diana avatar" />
        </section>
        <section>
          <h1>
            <Link href="/">
              <a> Diana Hern√°ndez </a>
            </Link>
          </h1>
          <h2>Desarrollo web</h2>

          <Link href="/blog">
            <a className="getStarted">BLOG</a>
          </Link>
        </section>
      </DefaultLayout>

      <style jsx>{home}</style>
    </>
  );
}
